import React, {Component} from 'react'
import './style.css'

class Todo extends Component{
  render(){
    return (
      <div className='todo'>
        <h1>TODO-REACT</h1>
        <div className="con">
          <div className="top"></div>
          <div className="list"></div>
          <div className="bom"></div>
        </div>
      </div>
    )
  }
}

export default Todo
